import logo from './logo.svg';
import './App.css';
import cart_item from './components/cart_item'
import './components/'
import React from 'react';
import ReactDOM from 'react-dom';

function App() {
  return (

    <div className="App">
      <div>
      <div className="home-product-item">
                    <div className="home-product-item__img" style={{ backgroundImage: 'url(https://cf.shopee.vn/file/c7487225392ba1286fc3682d12f179c3)' }}>
                    </div>
                    {/* Đổi tên */}
                    <h4 className="home-product-item__name">Bộ sách Làm Giàu Từ Chứng Khoán phiên bản mới + Hướng Dẫn Thực Hành CANSLIM Cho Người Mới Bắt Đầu</h4>
                    <div className="home-product-item__price">
                        {/* Giá cũ */}
                        <span className="home-product-item__price-old">1.000.000đ</span>
                        {/* Giá mới */}
                        <span className="home-product-item__price-current">700.000đ</span>
                    </div>
                    <div className="home-product-item__action">
                        {/* neu like thi them class  home-product-item__liked vao the span*/}
                        <span className="home-product-item__like">
                            <i className="home-product-item__like-icon far fa-heart" />
                            <i className="home-product-item__liked-icon fas fa-heart" />
                        </span>
                        <div className="home-product-item__rating">
                            <i className="home-product-item__star--gold fas fa-star" />
                            <i className="home-product-item__star--gold fas fa-star" />
                            <i className="home-product-item__star--gold fas fa-star" />
                            <i className="home-product-item__star--gold fas fa-star" />
                            <i className="fas fa-star" />
                        </div>
                        {/* Số sản phẩm đã bán */}
                        <span className="home-product-item__sold">1k2 đã bán</span>
                    </div>
                    <div className="home-product-item__origin">
                        {/* Nhà xuất bản */}
                        <span className="home-product-item__brand">Fahasa</span>
                        {/* Xuất xứ */}
                        <span className="home-product-item__origin-name">Việt Nam</span>
                    </div>
                    <div className="home-product-item__favourite">
                        <i className="fas fa-check" />
                        <span>
                            Yêu thích
                        </span>
                    </div>
                    <div className="home-product-item__sale-off">
                        {/* Số % giảm dựa vào giá cũ và giá mới */}
                        <span className="home-product-item__sale-off-percent">30%</span>
                        <div className="home-product-item__sale-off-label">GIẢM</div>
                    </div>
                </div>

      </div>
    </div>

  );
}

export default App;
